import React from 'react'

const Card = (props) => 
{
    return (
        <div className='tc bg-light-green dib br3 ma2 pa3 bw2 shadow-5 grow'>
            <img alt='robots' src={'https://robohash.org/${props.id}?200x200'}></img>
            <div>
                <h2>{props.name}</h2> 
                <p>{props.email}</p>
            </div>
        </div>

    );
}

export default Card;
